Starring : Asa Akira, Evan Stone, Tommy Gunn, Andy San Dimas, Lexington Steele, Allie Haze, Xander Corvus, Maya Hills, Derrick Pierce, Aiden Ashley, Charmane Star 

Wolverine is a mutant with an unbreakable skeleton, retractable adamantium claws, and a healing ability that reverses nearly any wound . His past however, is shrouded in mystery. Calling him self Logan, Wolverine has spent years trying to unravel the layers of his own history. Will Domino, a female mutant with luck abilities help Wolverine stitch together the threads of his past? And what about the insidious Sabretooth ... can Wolverine help Domino find him? They track Wolverine's more brutal counterpart, but must face Lady Deathstrike and Deadpool along the way. The trio prove too much for Wolverine and Domino; it'll take Phoenix and Rogue to save them! All Knives are out as Axel Braun presents His New superhero epic, Wolverine!

